Como instrumento fue creado en 1927, a partir del gran interés de los empresarios estadounidenses en invertir en bolsas extranjeras y hasta cobrar dividendos, y por el interés de las compañías internacionales en cotizar en la Bolsa de Estados Unidos.
Para la década de los ochenta creció el número de colocaciones de ADRs, y en 1990 fue  colocado el primer ADR proveniente de un país de América Latina en el mercado bursátil norteamericano, el ADR de Compañía de Teléfonos de Chile ( CTC).

De esta forma, los inversores estadounidenses pueden invertir en empresas de fuera de su país con la particularidad de seguir operando en la misma moneda, sin necesidad de pasar por un cambio de divisa. 

¿Por qué le interesa a la empresa cotizar en Estados Unidos con ADR?
Podríamos decir que hay tres causas principales:
* Entrada al mayor mercado de valores del mundo. Es una forma de que sus acciones ganen volumen, permitiendo a inversores de todo el mundo operar en dólares a través de su broker americano.
* Menores costes. Cotizar en las bolsas americanas como empresa listada es mucho más caro que cotizar con ADR. Mediante este producto, los requisitos tanto de la SEC como de las bolsas son menores, es decir, implican menos costes.
* Imagen y notoriedad. Las empresas quieren estar establecidas en el principal mercado de acciones mundial.
