On a related note, if I may give you an advice, just remember that nothing is wasted. A relationship that does not work, a job opportunity that is what you thought it would be, a friendship that ends, a personal tragedy... All of these things are here to teach you something you have yet to learn or something you need to be reminded about. Go through the storm the best way you can, trust that you will come out, and as you do, through the pain, the trauma, the bruises and everything else, find the lesson(s) and learn it/them. It will grow you and add another tool to your life toolbelt.";}i:147;a:1:{s:14:"comments_count";i:2;}i:148;a:1:{s:11:"likes_count";i:1;}i:149;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEvTzVcF-tU";}i:150;a:1:{s:5:"image";s:238:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/118769175_769625593582074_7148504414280635567_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=106&_nc_ohc=TQiPFpbI_JUAX9UNVpC&oh=ba647269f51c6797b9311c4f0883e223&oe=5F7C249F";}i:151;a:1:{s:4:"type";s:5:"image";}i:152;a:1:{s:8:"owner_id";i:4867552159;}i:153;a:1:{s:14:"owner_username";s:0:"";}i:154;a:1:{s:14:"owner_fullname";s:0:"";}i:155;a:1:{s:9:"owner_pic";s:0:"";}i:156;a:1:{s:2:"id";s:19:"2391216472124762170";}i:157;a:1:{s:10:"short_code";s:11:"CEvTrZSDyg6";}i:158;a:1:{s:12:"created_time";i:1599275238;}i:159;a:1:{s:7:"caption";s:330:"🦋

